import React from 'react';

const ResumeDiv = (props) => {
  return (
    <div>
      <h1>{props.h1}</h1>
        <h5>{props.h5}</h5>
        <h3>{props.h3} </h3>
        <h5>{props.h5College}</h5>
        <p>{props.pre}</p>
        <p className=''>{props.p}</p>
    </div>
  );
}

export default ResumeDiv;
